const URL_API = 'https://swapi.dev/api/planets';

const fetchPlanetsAPI = async () => {
  const result = await fetch(URL_API);
  const data = await result.json();
  // Resultado sem a key residents do Objeto da API
  const finalResult = data.results.map((planet) => {
    delete planet.residents;
    return planet;
  });
  return finalResult;
};

export default fetchPlanetsAPI;
